import React from "react";

export default function Form() {
  const { container, inputStyle } = styles;

  return (
    <div className="center">
      <div className="input-field col s6">

      </div>
    </div>
  );
}

const styles = {
  container: {
    display: "flex",
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "center",
  },
  inputStyle: {
    width: "300px",
    marginLeft: "30px",
  },
};
